import ExpenseItem from "./components/ExpenseItem"


function Expenses ( props )
{
    const expanses = [
        {
          date : new Date(2022,2,10),
          title :"Car Insurance",
          amount : 297.64
        },
          {
          date : new Date(2022,2,11),
          title :"Car Insurance",
          amount : 297.64
        },
        {
          date : new Date(2022,2,12),
          title :"Car Insurance",
          amount : 297.64
        }]

    return (<div> 
    <ExpenseItem title={expanses[0].title} amount={expanses[0].amount} date={expanses[0].date}></ExpenseItem>
    <ExpenseItem title={expanses[1].title} amount={expanses[1].amount} date={expanses[1].date}></ExpenseItem>
    <ExpenseItem title={expanses[2].title} amount={expanses[2].amount} date={expanses[2].date}></ExpenseItem>
    </div>);
}

export default Expenses;
